import {
    Box,
    Button,
    Card,
    CardActions,
    CardContent,
    Container,
    Grid,
    Typography,
    Dialog,
    List,
    ListItem,
    ListItemIcon,
    ListItemText,
    DialogTitle,
    DialogContent,
    DialogContentText,
    DialogActions,
    Divider,
  } from "@mui/material";

const Clients = () => {
  return (
    <Container sx={{ py: 2 }}>
      <Typography
        variant="h2"
        sx={{
          textAlign: "center",
          color: "#000032",
          mb: 2,
          fontWeight: "bold",
        }}
      >
        Services
      </Typography>
      <Grid container gap={1} justifyContent="space-around">
        {[1,2,3,4,4,5].map((item) => (
          <Grid item xs={12} md={2}>
            <Card elevation={5} sx={{maxWidth:100}}>
                <Typography
                  sx={{ color: "#f99f00" }}
                >
                 <img src="logo192.png" alt="" width={100} />
                </Typography>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Clients;
